import React from 'react'
import styled from 'styled-components'
import {AiFillLinkedin} from 'react-icons/ai'


const Heading =styled.div`
color:#fff;
display:flex;
justify-content:space-between;
align-items:center;
`
const LogoIcon =styled.h1`

`
const SocialIcons = styled.div`
display:flex;
justify-content:space-between;
p{
    padding-left:10vh;
}
`
const Logo = () => {
    return (
        <Heading>
            <LogoIcon>Jeffrey</LogoIcon>
<SocialIcons>
<div>
<p>Email</p>
</div>

<div><AiFillLinkedin/><p>Linkden</p></div>


</SocialIcons>
        </Heading>
    )
}

export default Logo
